            with(obj) __p += '<div class="onboarding2" ng-class="{minimise: onb.minimise, hide: onb.hide, \'no-footer\': onb.getCurrentStep(onb.currentStep) === 0}" ng-if="!onb.close">\n  <div class="header" ng-click="onb.minimiseOff($event)">\n    <div class="title">\n      <span ng-bind="onb.getStepTitle()"></span><span ng-if="!onb.onbTypePro" ng-bind="onb.satesTitles[onb.getCurrentStep(onb.currentStep)].t2" class="green"></span><span ng-if="onb.onbTypePro" ng-bind="onb.satesTitlesPro[onb.getCurrentStep(onb.currentStep)].t2" class="green"></span>\n    </div>\n    <div\n      class="button-ver2 icon min-max"\n      ng-class="{\'max\': !onb.minimise, \'min\': onb.minimise}"\n      ng-click="onb.minimiseOn($event)"\n      ng-if="onb.getCurrentStep(onb.currentStep) !== 10"\n    ></div>\n    <div\n      class="button-ver2 icon close-small"\n      ng-click="onb.onbHide()"\n      ng-if="onb.getCurrentStep(onb.currentStep) === 10"\n    ></div>\n  </div>\n  <div class="content" ng-class="{\'dir-prev\': onb.directionStep === -1, \'dir-next\': onb.directionStep === 1, \'dir-prev-end\': onb.directionStepEnd === -1, \'dir-next-end\': onb.directionStepEnd === 1}">\n\n    <div class="state state-step-0 into"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 0, current: onb.getCurrentStep(onb.currentStep) === 0}"\n         ng-if="onb.getCurrentStep(onb.currentStep) === 0 || onb.getCurrentStep(onb.oldStep) === 0"\n    >\n    <div ng-if="!onb.onbTypePro">\n      <span class="image basic"></span>\n      <div class="text-wrapper">\n        <p class="title">\n          Basic Tutorial\n        </p>\n        <ul>\n          <li>Learn the main principles of chatbot building</li>\n          <li>Set up your bot’s Artifficial Intelligence dialogue</li>\n          <li>Find out how to attract users to your bot</li>\n        </ul>\n        <p>\n          <span class="button-ver2 orange-rounded gogo" ng-click="onb.getStarted();">\n            GET STARTED!\n          </span>\n        </p>\n      </div>\n    </div>\n      <div ng-class="{\'disabled-wrapper\': !onb.onbTypePro}">\n        <span class="image pro"></span>\n        <div class="text-wrapper">\n          <p class="title">\n            Advanced Tutorial\n          </p>\n          <ul>\n            <li>Learn main techniques for building a bot for your specific use case</li>\n            <li>Become familiar with the most powerful Chatfuel features to create advanced chatbots</li>\n          </ul>\n          <div class="info" ng-if="!onb.onbTypePro">\n            Complete the Basic Tutorial first to access the Advanced Tutorial\n          </div>\n          <p ng-if="onb.onbTypePro">\n            <span class="button-ver2 orange-rounded gogo" ng-click="onb.getStarted();">\n              GET STARTED!\n            </span>\n          </p>\n        </div>\n      </div>\n    </div>\n\n    <div class="state state-step-1"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 1, current: onb.getCurrentStep(onb.currentStep) === 1}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 1 || onb.getCurrentStep(onb.oldStep) === 1) && !onb.onbTypePro"\n    >\n      <div class="img s11"></div>\n      <p>\n        A typical bot consists of blocks. A block is one or more messages (text, image etc.) a user receives at once.\n      </p>\n      <p>\n        You can connect two blocks by creating a button in one block and linking it to the other one.\n      </p>\n    </div>\n\n    <div class="state state-step-1"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 1, current: onb.getCurrentStep(onb.currentStep) === 1}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 1 || onb.getCurrentStep(onb.oldStep) === 1) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s11p"></span>\n      </p>\n      <p>\n        According to Facebook Broadcasting Policy, you need to get an agreement from your users to receive broadcast notifications from your bot.\n      </p>\n      <p>\n        Learn how to let your user opt-in to receive broadcasts by creating a bot from the Broadcast Permissions Tutorial Template.\n      </p>\n      <p>\n        <span class="button-ver2 orange-rounded template" ng-class="{disabled: onb.isTempCreated}" ng-click="onb.createBotFromTemplate(0, true)">\n          OPEN PERMISSIONS TEMPLATE\n        </span>\n      </p>\n      <p class="small">Pushing the button above will create a bot from this template in your dashboard.</p>\n    </div>\n\n\n    <div class="state state-step-2"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 2, current: onb.getCurrentStep(onb.currentStep) === 2}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 2 || onb.getCurrentStep(onb.oldStep) === 2) && !onb.onbTypePro"\n    >\n      <p>\n        <span class="text-inline v1"><b>1.</b> In the Bot structure on the left click on <b>+ Add Block</b> button.</span>\n        <span class="text-inline v2"><b>1.</b> In the Bot structure on the left click on <b>+</b> button.</span>\n        <span class="img s21"></span>\n      </p>\n      <p>\n        <b>2.</b> Name the block and add a text card.\n        <span class="img s22"></span>\n      </p>\n      <p>\n        <b>3.</b> Enter text in the text card.\n        <span class="img s23"></span>\n      </p>\n      <p>\n        <span class="ic-emoji-partypopper"></span> Perfect! Now you know how to create simple bot content. Click next when ready.\n      </p>\n    </div>\n\n    <div class="state state-step-2"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 2, current: onb.getCurrentStep(onb.currentStep) === 2}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 2 || onb.getCurrentStep(onb.oldStep) === 2) && onb.onbTypePro"\n    >\n      <p>\n        <b>1.</b> Navigate through the blocks in order as labeled ① > ② > ③</span>\n        <span class="img s21p"></span>\n      </p>\n      <p>\n        <b>2.</b> If you see <span class="ic-emoji-partypopper edu-icon"></span> emoji — this is educational text. If you see <span class="ic-emoji-partypopper bot-icon"></span> emoji — this is text of the bot\n      </p>\n      <p>\n        <b>3.</b> Take some time to learn all functionalities of each Template\n      </p>\n      <p>\n        <b>4.</b> Play with your template bot using “Test This Chatbot” button\n        <span class="img s22p"></span>\n      </p>\n    </div>\n\n    <div class="state state-step-3"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 3, current: onb.getCurrentStep(onb.currentStep) === 3}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 3 || onb.getCurrentStep(onb.oldStep) === 3) && !onb.onbTypePro"\n    >\n      <p>\n        <b>1.</b> For example, open the Welcome Message block.\n        <span class="img s31"></span>\n      </p>\n      <p>\n        <b>2.</b> This is a simple Text Card. Click on <b>+ Add Button</b> at the bottom of the text card.\n        <span class="img s32"></span>\n      </p>\n      <p>\n        <b>3.</b> In the Blocks tab click on the input bar and choose an existing block.\n        <span class="img s33"></span>\n      </p>\n      <p>\n        <span class="ic-emoji-partypopper"></span> Amazing! That wasn\'t too hard, was it? This is how bot structure is put together. Click next when ready.\n      </p>\n    </div>\n\n    <div class="state state-step-3"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 3, current: onb.getCurrentStep(onb.currentStep) === 3}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 3 || onb.getCurrentStep(onb.oldStep) === 3) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s31p"></span>\n      </p>\n      <p>\n        Learn how to get users’ input saved in your bot for future use or receive it in your email inbox by taking a look at the User Input Template.\n      </p>\n      <p>\n        <span class="button-ver2 orange-rounded template" ng-class="{disabled: onb.isTempCreated}" ng-click="onb.createBotFromTemplate(1)">\n          OPEN USER INPUT TEMPLATE\n        </span>\n      </p>\n    </div>\n\n    <div class="state state-step-4"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 4, current: onb.getCurrentStep(onb.currentStep) === 4}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 4 || onb.getCurrentStep(onb.oldStep) === 4) && !onb.onbTypePro"\n    >\n      <p>\n        <b>1.</b> Click on Test This Chatbot in the top right corner of the screen to start chatting.\n        <span class="img s41"></span>\n      </p>\n      <p>\n        <b>2.</b> Now you can chat with your bot in Messenger, or click the View on Messenger.com button.\n        <span class="img s42"></span>\n      </p>\n      <p>\n        <b>3.</b> Sign in to Messenger using your Facebook login to open a chat session.\n        <span class="img s43"></span>\n      </p>\n      <p>\n        <span class="ic-emoji-partypopper"></span> Awesome, isn\'t it? You can test your bot anytime to ensure the best user experience.\n      </p>\n    </div>\n\n    <div class="state state-step-4"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 4, current: onb.getCurrentStep(onb.currentStep) === 4}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 4 || onb.getCurrentStep(onb.oldStep) === 4) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s41p"></span>\n      </p>\n      <p>\n        All your users are different and have different interests and preferences. You can save their specific attributes in the\n        bot and use that information later to broadcast targeted messages and provide personalized bot flows. Learn how to do it using the Segmentation Template.\n      </p>\n      <p>\n        <span class="button-ver2 orange-rounded template" ng-class="{disabled: onb.isTempCreated}" ng-click="onb.createBotFromTemplate(2)">\n          OPEN SEGMENTATION TEMPLATE\n        </span>\n      </p>\n    </div>\n\n    <div class="state state-step-5"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 5, current: onb.getCurrentStep(onb.currentStep) === 5}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 5 || onb.getCurrentStep(onb.oldStep) === 5) && !onb.onbTypePro"\n    >\n      <p>\n        The AI engine helps your bot understand what users are saying. Let’s set up how your bot replies.\n      </p>\n      <p>\n        <b>1.</b> Open the Set Up AI tab in the left navigation bar.\n        <span class="img s51"></span>\n      </p>\n      <p>\n        <b>2.</b> To create an AI rule click the + button.\n        <span class="img s52"></span>\n      </p>\n      <p>\n        <b>3.</b> Add user phrases and bot responses.\n        <span class="img s53"></span>\n      </p>\n      <p>\n        <b>4.</b> Perfect! Now Click on Test This Chatbot to see the AI in action.\n        <span class="img s54"></span>\n      </p>\n      <p>\n        <span class="ic-emoji-partypopper"></span> Cool! Using AI in your bot adds a WOW feature that makes conversations more natural.\n      </p>\n    </div>\n\n    <div class="state state-step-5"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 5, current: onb.getCurrentStep(onb.currentStep) === 5}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 5 || onb.getCurrentStep(onb.oldStep) === 5) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s51p"></span>\n      </p>\n      <p>\n        Learn how to redirect users to different parts of the bot flow randomly or based on specific attributes by checking out the Routing Template.\n      </p>\n      <p>\n        <span class="button-ver2 orange-rounded template wide-btn" ng-class="{disabled: onb.isTempCreated}" ng-click="onb.createBotFromTemplate(3)">\n          OPEN ROUTING TEMPLATE\n        </span>\n      </p>\n    </div>\n\n    <div class="state state-step-6 center"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 6, current: onb.getCurrentStep(onb.currentStep) === 6}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 6 || onb.getCurrentStep(onb.oldStep) === 6) && !onb.onbTypePro"\n    >\n      <p>\n        <span class="img s61"></span>\n      </p>\n      <p>\n        You\'ve learned the basics of chatbot-building. Now take your time and create a bot you can be proud of! Use the "-" icon at top right to minimize this guide.\n      </p>\n      <p>\n        Click Next when you are ready to continue.\n      </p>\n    </div>\n\n    <div class="state state-step-6"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 6, current: onb.getCurrentStep(onb.currentStep) === 6}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 6 || onb.getCurrentStep(onb.oldStep) === 6) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s61p"></span>\n      </p>\n      <p>\n        This template will show you how to take over the conversation from the bot to talk with your users.\n        You can also receive notifications about new messages received from the bot\'s audience.\n      </p>\n      <p>\n        <span class="button-ver2 orange-rounded template" ng-class="{disabled: onb.isTempCreated}" ng-click="onb.createBotFromTemplate(4)">\n          OPEN LIVE CHAT TEMPLATE\n        </span>\n      </p>\n    </div>\n\n    <div class="state state-step-7"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 7, current: onb.getCurrentStep(onb.currentStep) === 7}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 7 || onb.getCurrentStep(onb.oldStep) === 7) && !onb.onbTypePro"\n    >\n      <p>\n        To make your bot publicly available, you need to connect it to your Facebook Page — not your personal Facebook profile,\n        but a page dedicated to your brand, business, band etc.\n        (just like the <a href="https://www.facebook.com/chatfuel" target="_blank">Chatfuel Facebook Page</a>).\n      </p>\n      <p>\n        <b>1.</b> Click on Connect to Facebook button in the top menu.\n        <span class="img s71"></span>\n      </p>\n      <p>\n        <b>2.</b> Now you are in the Configure tab. Find Publish to Facebook section.\n        <span class="img s72"></span>\n      </p>\n      <p>\n        <b>3.</b> Press «Connect to Facebook now» and provide access to manage your Pages.\n        This permission does not apply to the management of your personal profile on Facebook but only for the business pages.\n        <span class="img s73"></span>\n      </p>\n      <p>\n        <b>4.</b> Create a Facebook Page if needed\n        <span class="img s74"></span>\n      </p>\n      <p>\n        <b>5.</b> Find your Facebook Page in the list and click on Connect button.\n        <span class="img s75"></span>\n      </p>\n      <p>\n        <b>6.</b> Cool, now your bot is publicly available! Click on Test this chatbot to see your bot in action.\n        <span class="img s76"></span>\n      </p>\n      <p>\n        <span class="ic-emoji-partypopper"></span> Excellent! Now your bot is public and can get a lot of users!\n      </p>\n    </div>\n\n    <div class="state state-step-7"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 7, current: onb.getCurrentStep(onb.currentStep) === 7}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 7 || onb.getCurrentStep(onb.oldStep) === 7) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s71p"></span>\n      </p>\n      <p>\n        People love to chat! You can create chat rooms in your bot to give users the ability to chat with each other. Learn how to do it with a Chat Room Template.\n      </p>\n      <p>\n        <span class="button-ver2 orange-rounded template wide-btn" ng-class="{disabled: onb.isTempCreated}" ng-click="onb.createBotFromTemplate(5)">\n          OPEN CHAT ROOM TEMPLATE\n        </span>\n      </p>\n    </div>\n\n    <div class="state state-step-8"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 8, current: onb.getCurrentStep(onb.currentStep) === 8}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 8 || onb.getCurrentStep(onb.oldStep) === 8) && !onb.onbTypePro"\n    >\n      <p>\n        <b>1.</b> Ask your friends to give you feedback on the first version of your bot, as well as share the bot’s <a href="https://m.me" target="_blank">m.me</a> link with their contacts\n      </p>\n      <p>\n        <b>2.</b> Place a “Share this bot” button in the persistent menu (see “Configure” tab) leading to a block containing a gallery card with a “Share” button.\n      </p>\n      <p>\n        <b>3.</b> Promote your bot on your existing social media accounts. To increase the visibility and engagement of the post promoting the chatbot, it helps to pin it to the top of your feed.\n      </p>\n      <p>\n        <b>4.</b> Employ an influencer, or a public figure (if you have access to one) to try your bot and share their thoughts on it through social media. Influencer marketing goes a long way when trying to promote your chatbot.\n      </p>\n      <p>\n        <a class="button-ver2 white-rounded link-btn" target="_blank" href="https://help.chatfuel.com/facebook-messenger/promotion/chatbot-promotion-tips-and-tools/">\n          SEE MORE PROMO TIPS\n        </a>\n      </p>\n    </div>\n\n    <div class="state state-step-8 center"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 8, current: onb.getCurrentStep(onb.currentStep) === 8}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 8 || onb.getCurrentStep(onb.oldStep) === 8) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s81"></span>\n      </p>\n      <p>\n        Congratulations! You\'ve completed the Advanced Tutorial and now know how to create great bots using Chatfuel.\n        We also recommend checking out our video tutorial for more tips and bot-building techniques.\n      </p>\n      <p>\n        <a class="button-ver2 blue-rounded video" target="_blank" href="http://www.craftain.com/project/create-a-facebook-messenger-bot-without-coding/lecture/what-we-are-going-to-build">\n          OPEN VIDEO TUTORIAL\n        </a>\n      </p>\n    </div>\n\n    <div class="state state-step-10 center done"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 10, current: onb.getCurrentStep(onb.currentStep) === 10}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 10 || onb.getCurrentStep(onb.oldStep) === 10) && !onb.onbTypePro"\n    >\n      <p>\n        <span class="img s101"></span>\n      </p>\n      <p>\n        Now you know how to create basic bots. Please enjoy Chatfuel and let your creativity flow! Chatfuel has a vibrant\n        community where you can always find answers to your questions.\n      </p>\n      <p>\n        <a class="button-ver2 blue-rounded video" target="_blank" href="https://community.chatfuel.com/c/messenger">\n          EXPLORE THE COMMUNITY\n        </a>\n      </p>\n    </div>\n\n    <div class="state state-step-10 center done"\n         ng-class="{old: onb.getCurrentStep(onb.oldStep) === 10, current: onb.getCurrentStep(onb.currentStep) === 10}"\n         ng-if="(onb.getCurrentStep(onb.currentStep) === 10 || onb.getCurrentStep(onb.oldStep) === 10) && onb.onbTypePro"\n    >\n      <p>\n        <span class="img s101p"></span>\n      </p>\n      <p>\n        We hope you found this guide useful.\n      </p>\n      <p>\n        We are continuously improving our service and welcome any feedback on how we can make this tutorial better.\n      </p>\n      <p>\n        Drop us a line: <a href="mailto:team@chatfuel.com">team@chatfuel.com</a>\n      </p>\n    </div>\n\n\n\n  </div>\n  <div class="footer" ng-class="{act: (onb.getCurrentStep(onb.currentStep) !== 0) }">\n    <div class="button-ver2 icon prev" ng-click="onb.prevStep()" ng-class="{act: onb.getCurrentStep(onb.currentStep) > 1 }"></div>\n    <div class="progress">\n      <div class="label"><span ng-bind="onb.progressValue">0</span>% {{onb.onbTypePro ? \'of Advanced Tutorial\' : \'of Basic Tutorial\'}}</div>\n      <div class="bar-box">\n        <div class="bar" ng-style="{width: onb.progressValue + \'%\'}"></div>\n      </div>\n    </div>\n    <div class="button-ver2 orange-rounded next"\n      ng-click="onb.nextStep($event)"\n      ng-if="onb.getCurrentStep(onb.currentStep) < 10 && !onb.onbTypePro">NEXT</div>\n    <div class="button-ver2 orange-rounded next"\n      ng-click="onb.nextStep($event)"\n      ng-if="onb.getCurrentStep(onb.currentStep) < 10 && onb.onbTypePro"\n      ng-class="{\'disabled\': !onb.isTempCreated && (onb.getCurrentStep(onb.currentStep) !== 0 && onb.getCurrentStep(onb.currentStep) !== 2 && onb.getCurrentStep(onb.currentStep) !== 8)}"\n      uib-tooltip="Create a bot from tutorial template to continue"\n      tooltip-placement="top-right"\n      tooltip-class="onboarding-tooltip"\n      tooltip-enable="!onb.isTempCreated && (onb.getCurrentStep(onb.currentStep) !== 2 && onb.getCurrentStep(onb.currentStep) !== 8)">NEXT</div>\n    <div class="button-ver2 orange-rounded finish" ng-click="onb.onbDone($event)" ng-if="onb.getCurrentStep(onb.currentStep) === 10">FINISH</div>\n  </div>\n</div>\n';
